import React, { useState } from 'react';
import './App.css';

function App() {
  const [todos, setTodos] = useState(['himashu','rajput']);
  return (
    <div className="App">
      <h1>Welcome to Todo-App</h1>
      <input/>
      <button>Add Todo</button>
      <ul>
        {todos.map(todo =>{
           return <li>{todo}</li>
        })}
      </ul>
    </div>
  );
}

export default App;
